My Sisters Hot Friend - Lizzy London 

Released : July 11, 2011

Johnny comes back from a bike ride to find his sister's friend Lizzy hanging at their house -- again. She's been there several weekends in a row, and she says her parents are out of town again and don't trust her by herself at their house. Johnny tries to avoid her by telling her that his sister thinks he's a bad influence on her friends; but apparently Lizzy's looking for trouble, because she flashes her nice tithes and taunts Johnny until he sticks his dick in her mouth!
